-- TABLE adminunit
CREATE TABLE IF NOT EXISTS dp.adminunit (
  n_id BIGINT NOT NULL COMMENT 'id εγγραφής',
  n_parentid BIGINT NULL COMMENT 'id πατέρα',
  n_level SMALLINT NOT NULL COMMENT 'Επίπεδο',
  v_type VARCHAR(20) NOT NULL COMMENT 'Τύπος',
  v_code VARCHAR(20) NULL COMMENT 'Κωδικός',
  v_name VARCHAR(100) NOT NULL COMMENT 'Ονομασία',
  PRIMARY KEY(n_id)
) ENGINE = INNODB COMMENT 'Διοικητική μονάδα';

CREATE INDEX adminunit_level_idx
ON dp.adminunit (n_level);

